const initialState = {
    agentsProjects: null,
}

const myAgentsReducer = (state = initialState, action) => {

    switch (action.type) {
        
        case 'GET_PROJECT_BY_PAGE' :
            return {
                ...state,
                agentsProjects: action.payload,
            }

        default:
            return state;
    }
}

export default myAgentsReducer;
